import React from 'react';
import './contact-description.styles.scss';


const ContactDescription = () => (

    <div
        className='contact-description'
    >
    <p>
    This is a website made by me using React.It was fun to make this website. I have used redux firebase and udemy respurces.
    </p>

        <div class="LI-profile-badge" data-version="v1" data-size="medium" data-locale="en_US" data-type="vertical" data-theme="light" data-vanity="mirmuizqaisar"><a class="LI-simple-link" href='https://au.linkedin.com/in/mirmuizqaisar?trk=profile-badge'>Muiz Qaisar Mir</a></div>

    </div>
);

export default ContactDescription;
